import trollFace from "../images/troll-face.png"

export default function Header() {
    return (
        <header className="header">
            <a href="https://www.vecteezy.com/free-vector/meme-icon">Meme Icon Vectors by Vecteezy
                <img 
                    src={trollFace} 
                />
            </a>
            <h1>Meme Generator</h1>
        </header>
    )
}
